import React from "react";

function Home({ user }, {userId}) {
    console.log(userId)
    return (
      <div>
        <h2>Home Page</h2>
        {user ? (
          <p>Welcome {user}</p>
        ) : (
          <p>Welcome to the Home Page</p>
        )}
      </div>
    );
  }

export default Home;
